import React from 'react'
import { Container, Row, Col } from 'reactstrap';

const objectPage = ( props ) => {
    const style = {
        height: '100%',
        width: '100%',
        objectFit: 'contain'
    };
    return(
        <Container>
            <Row>
                <Col>
                    <img style={style} src={ props.img }/>
                </Col>
                <Col>
                    <p>Price: ${props.price}</p>
                </Col>
            </Row>
        </Container>
    )
};

export default objectPage;
